import React, { Component } from 'react';
import classes from'./Header.module.css';
import {  Router, Route, Link } from 'react-router-dom';
import Preorder from '../../../Orders/order';
class Header extends Component{
 render(){
     return 
        <Router><div className={classes.header}>  
        Welcome To Order! 
        <a className={classes.label1}> Burger Builder</a>
         <a className={classes.label2}> 
            <Link to ='../../../Orders/order'> Orders</Link>
        </a>
         <Route path='../../../Orders/order' ><Preorder/> </Route> 
        </div> 
        </Router>
    
 }
}
export default Header;
